import React, { useState } from 'react';
import Krangeslider from './rangeslider';

function KrangesliderLadder () {

  const [ value, setValue ] = useState(50);

  return (
    <div class='inlined'>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Green Pepper</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
    </div>

  );

};

export default KrangesliderLadder;
